          "etag": "ig0Nuifq2BxhQrgXxzHUcVHn4i4",
          "id": "UgxkBc817dQrKmW6ETt4AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "In all this videos I can&#39;t understand the analogy of the trains having relative speed compared to the speed of light being constant? So suppose I travel in a train at the speed of light, how would I see a light wave being constant?",
